function Navbar({ onPlay, onPause, onVolumeChange }) {
    const [isPlaying, setIsPlaying] = React.
    return (
        <nav className="navbar">
            <button onClick={onPlay}>Play</button>
            <button onClick={onPause}>Pause</button>
            <input type="range" min="0" max="100" onChange={(e) => onVolumeChange(e.target.value)} />
        </nav>
    );
}

export default Navbar;
